query ItemCountsQuery($id: ID!, $itemType: ItemEnum!) {
  item(id: $id, itemType: $itemType) {
    id
    counts {
      loves
      views
      forks
    }
  }
}

fragment ForkDetails on Item {
  id
  title
  url
  ... on Pen {
    previews {
      screenshot {
        small
      }
    }
  }
  ... on Project {
    previews {
      screenshot {
        small
      }
    }
  }
  owner {
    id
    title
    baseUrl
    avatar80
  }
}

fragment LoverDetails on User {
  id
  title
  baseUrl
  avatar80
}

query ItemForksQuery($itemId: ID!, $itemType: ItemEnum!) {
  item(id: $itemId, itemType: $itemType) {
    id
    counts {
      forks
    }
  }
  itemForks(itemId: $itemId, itemType: $itemType) {
    ...ForkDetails
  }
}

query ItemLoversQuery($itemId: ID!, $itemType: ItemEnum!) {
  item(id: $itemId, itemType: $itemType) {
    id
    counts {
      loves
    }
  }
  itemLovers(itemId: $itemId, itemType: $itemType) {
    ...LoverDetails
  }
}

# For the expanded Stats list modal
query PaginatedItemLoves($input: ItemLovesInput!) {
  itemLoves(input: $input) {
    users {
      ...LoverDetails
      username
    }
    pageInfo {
      hasNextPage
      previousCursor
      nextCursor
    }
  }
}

query PaginatedPenForks($input: PensInput!) {
  pens(input: $input) {
    pens {
      ...ForkDetails
    }
    pageInfo {
      hasNextPage
      previousCursor
      nextCursor
    }
  }
}

query PaginatedProjectForks($input: ProjectsInput!) {
  projects(input: $input) {
    projects {
      ...ForkDetails
    }
    pageInfo {
      nextCursor
    }
  }
}
