fragment GridItemFields on Item {
  id
  title
  itemType
  private
  url
  createdAt
  updatedAt
  owner {
    id
    avatar80
    ownerType
    baseUrl
    title
    username
    anon
    pro
    sessionUser {
      isBlockedByOwner
    }
  }
  counts {
    comments
    views
    loves
  }
  sessionUser {
    ownsItem
    loveLevel
  }
  ... on Pen {
    ...GridPenFields
  }
  ... on Post {
    ...GridPostFields
  }
  ... on Project {
    ...GridProjectFields
  }
  ... on Collection {
    ...GridCollectionFields
  }
}

# Fields on Pen
fragment GridPenFields on Pen {
  urls {
    details
    full
  }
  previews {
    iframeUrl
    screenshot {
      large
    }
  }
}

# Fields on Project
fragment GridProjectFields on Project {
  urls {
    details
    full
  }
  previews {
    screenshot {
      large
    }
  }
}

# Fields on Post
fragment GridPostFields on Post {
  previews {
    longSummary {
      processed {
        body
      }
    }
    summary {
      processed {
        body
      }
    }
  }
}

fragment GridCollectionFields on Collection {
  description {
    processed {
      body
    }
  }
  counts {
    pens
  }
  urls {
    full
  }
  previews {
    previewScreenshots {
      small
    }
